import React from "react";
import "./Home.css";
import User from "../User/User";
import sampleAvatar from "../../assets/PIC.jpg";

const Home = () => {
  return (
    <div className="home">
        <div className="homeleft">

        </div>
        <div className="homeright">
            <User 
                userId={"user._id"}
                name={"Chaitanya"}
                avatar={sampleAvatar}
            />
        </div>
    </div>
  )
}
export default Home;
